import "./App.css";
import HomeMain from "./Pages/HomeMain";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Redirect,
} from "react-router-dom";
import NotFound from "./Pages/404Page";
import HomeStudent from "./Pages/HomeStudent";
import HomeCompany from "./Pages/HomeCompany";
import { AuthProvider } from "./contexts/AuthContext";
import PrivateRoute from "./components/PrivateRoute";
import ResetPassword from "./components/ResetPassword";
import SignUpPage from "./components/SignUpPage";

function App() {
  return (
    <AuthProvider>
      <Router>
        <Switch>
          <Route
            exact
            path="/"
            render={(props) => (
              <HomeMain
                {...props}
                sign={{ isSign: false, signup: false, type: "" }}
              />
            )}
          />
          <Route
            exact
            path="/Home"
            render={(props) => (
              <HomeMain
                {...props}
                sign={{ isSign: false, signup: false, type: "" }}
              />
            )}
          />
          <Route exact path="/Home/SignUp" component={SignInPage} />
          <Route exact path="/Home/SignIn" component={SignUpPage} />
          <PrivateRoute exact path="/HomeStudent" component={HomeStudent} />
          <PrivateRoute exact path="/HomeCompany" component={HomeCompany} />
          <Route exact path="/ResetPassword" component={ResetPassword} />
          <Route exact path="/404NotFound" component={NotFound} />
          <Redirect to="/404NotFound" />
          {/* Bunun hiçbir koşulu olmadığı için ne olursa olsun çalışacak o yüzden en altta kalmalı*/}
        </Switch>
      </Router>
    </AuthProvider>
  );
}

export default App;
